from collections import defaultdict


class Solution:
    def isTransformable(self, s: str, t: str) -> bool:
        if s == t:
            return True
        c1 = defaultdict(int)
        for c in s:
            c1[c] += 1
        for c in t:
            if c1[c] == 0:
                return False
            c1[c] -= 1
        pre = defaultdict(int)
        c1 = defaultdict(int)
        for c in s:
            c = int(c)
            for i in range(c + 1, 10):
                if pre[i]:
                    c1[i, c] += pre[i]
            pre[c] += 1
        pre = defaultdict(int)
        for c in t:
            c = int(c)
            for i in range(c + 1, 10):
                if pre[i]:
                    c1[i, c] -= pre[i]
                if c1[i, c] < 0:
                    return False
            pre[c] += 1
        return True


# 5503. 所有奇数长度子数组的和.py


def main():
    sol = Solution()
    s, t = "3156", "1365"
    s, t = \
        "", ""
    res = sol.isTransformable(s, t)
    print(res)


if __name__ == '__main__':
    main()
